/* Classes */
.class-icon.icon_box { width: 6rem; height: 6rem; margin-left: auto; margin-right: auto; flex: 0 0 auto; border: 1px solid #b0b0b0; background: rgba(255, 255, 255, 0.5); }

.field input { color: #505050; background: none; }

.field.field--temp .field__box { border-bottom: 0.2rem solid #b0b0b0; }

.field.field--temp .field__frame { margin-bottom: -0.1rem; }

.field.field--temp .field__box.field__box--border_full { border: 0.2rem solid #b0b0b0; border-radius: 0.4rem; outline-radius: 0.4rem; -moz-outline-radius: 0.4rem; }

.field.field--temp.field--icon .field__box.field__box--border_full { border-left: 0 none; }

